import React, { useState } from 'react';
import { CognitoUserPool, CognitoUserAttribute, CognitoUser } from 'amazon-cognito-identity-js';
import { useHistory } from 'react-router-dom';
import './styles.css'; // Import the CSS file

const poolData = {
  UserPoolId: 'your-user-pool-id', // Replace with your User Pool ID
  ClientId: 'your-client-id', // Replace with your Client ID
};
const userPool = new CognitoUserPool(poolData);

function Signup() {
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [verificationCode, setVerificationCode] = useState('');
  const [isVerifying, setIsVerifying] = useState(false);
  const [errors, setErrors] = useState({});
  const history = useHistory();

  const handleSubmit = (event) => {
    event.preventDefault();
    const validationErrors = validateForm();
    if (Object.keys(validationErrors).length > 0) {
      setErrors(validationErrors);
    } else {
      const attributeList = [
        new CognitoUserAttribute({ Name: 'email', Value: email }),
      ];

      userPool.signUp(username, password, attributeList, null, (err, result) => {
        if (err) {
          alert(err.message || JSON.stringify(err));
          return;
        }
        console.log('User signed up successfully:', result.user);
        setIsVerifying(true);
      });
    }
  };

  const validateForm = () => {
    const errors = {};
    if (!username) {
      errors.username = 'Username is required';
    }
    if (!email) {
      errors.email = 'Email is required';
    } else if (!/\S+@\S+\.\S+/.test(email)) {
      errors.email = 'Email is invalid';
    }
    if (!password) {
      errors.password = 'Password is required';
    } else if (
      !/^(?=.*[A-Z])(?=.*\d)(?=.*[@$!%*?&])[A-Za-z\d@$!%*?&]{8,}$/.test(password)
    ) {
      errors.password = 'Password must be at least 8 characters, include one uppercase letter, one number, and one symbol';
    }
    return errors;
  };

  const handleVerification = (event) => {
    event.preventDefault();
    const userData = {
      Username: username,
      Pool: userPool,
    };

    const cognitoUser = new CognitoUser(userData);
    cognitoUser.confirmRegistration(verificationCode, true, (err, result) => {
      if (err) {
        alert(err.message || JSON.stringify(err));
        return;
      }
      alert('User verified successfully!');
      console.log('Verification successful:', result);
      history.push('/signin'); // Redirect to sign-in page
    });
  };

  return (
    <div className="container">
      <h2>Signup Page</h2>
      {!isVerifying ? (
        <form onSubmit={handleSubmit}>
          <div>
            <label>Username: </label>
            <input
              type="text"
              value={username}
              onChange={(e) => setUsername(e.target.value)}
            />
            {errors.username && <span className="error">{errors.username}</span>}
          </div>
          <div>
            <label>Email: </label>
            <input
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
            />
            {errors.email && <span className="error">{errors.email}</span>}
          </div>
          <div>
            <label>Password: </label>
            <input
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
            {errors.password && <span className="error">{errors.password}</span>}
          </div>
          <button type="submit">Signup</button>
        </form>
      ) : (
        <form onSubmit={handleVerification}>
          <div>
            <label>Verification Code: </label>
            <input
              type="text"
              value={verificationCode}
              onChange={(e) => setVerificationCode(e.target.value)}
            />
            {errors.verificationCode && <span className="error">{errors.verificationCode}</span>}
          </div>
          <button type="submit">Verify</button>
        </form>
      )}
    </div>
  );
}

export default Signup;
